function aggregateODData(){
	if(!odData)
		return;
	odData.forEach(function(row, index){
		//console.log(row)
		var sr = row['STARTREGION'];
		var er = row['ENDREGION'];
		if(sr != -1 && er != -1)
		{
			var start = sr.split('_')[0];
			var end = er.split('_')[0];
			var n = +row['NUMVISITS'];

			if(!(start in startRegions))
			{
				startRegions[start] = {};
			}
			startR = startRegions[start];
			if(!(end in startR))
			{
				startR[end] = n;
			}
			else
			{
				startR[end] += n;
			}
			if(maxN < startR[end])
				maxN = startR[end];
		}
		else
		{
			console.log('invalid row', row, index);
		}
	})
	console.log('maxN', maxN);
	odData = null;
	var d = JSON.stringify(startRegions);
	console.log('caching startRegions',d.length)
	localStorage.setItem('startRegions', d);
	localStorage.setItem('startRegionsMaxN', maxN);
}

function convertTimestamp(json){
	json.forEach(function(row){
		var time = row[independent];
		row.timestamp = moment(time).valueOf(); // convert to unix epoc time
	})
}

function queryData(data, field, value)
{
	var cv;
	var d = [];
	for(var i=0; i<data.length; ++i)
	{
		var item = data[i];
		var v = item[field];
		if(value <= v)
		{
			if(cv == undefined)
				cv = v;
			if(cv == v)
				d.push(item)
			else
				break;
		}
	}

	return Promise.resolve(d);
}


function queryDataRange(data, field, value1, value2)
{
	var cv;
	var d = [];
	for(var i=0; i<data.length; ++i)
	{
		var item = data[i];
		var v = item[field];
		if(v>=value1 && v<value2)
		{
			if(cv == undefined)
				cv = v;
			d.push(item)
		}
		if(v>=value2)
			break;
	}

	return Promise.resolve(d);
}

